import { INVALID_MOVE } from 'boardgame.io/core';

export const clickCell = (G,ctx,id) => {
	console.log('ccccccccccc',id);
	if (G.cells[id] !== null) {
		return INVALID_MOVE;
	}
	G.cells[id] = Object.assign({...G.cells[id]}, id);
}

export default {
	clickCell
}
